  null,\n\t\"notes\": \"TASK NAME:(NRCS) Saginaw Bay, MI LiDAR LiDAR Data Acquisition
  and Processing Production Task USGS Contract No. G10PC00057 Task Order No. G11PD01254
  Woolpert Order No. 071804 CONTRACTOR: Woolpert, Inc. LiDAR data is a remotely sensed
  high resolution elevation data collected by an airborne platform. The LiDAR sensor
  uses a combination of laser range finding, GPS positioning, and inertial measurement
  technologies. The LiDAR systems collect data point clouds that are used to produce
  highly detailed Digital Elevation Models (DEMs) of the earth's terrain, man-made
  structures, and vegetation. The task required the LiDAR data to be collected at
  a nominal pulse spacing (NPS) of 0.7 meter. The final products include first, last,
  and at least one intermediate return LAS, full classified LAS and one (1) meter
  pixel raster DEMs of the bare-earth surface in ERDAS IMG Format. The LiDAR data
  was acquired on November 18, 2011, November 21, 2011, November 22, 2011, November
  23, 2011, December 26, 2011, April 4, 2012, April 5, 2012, and April 6, 2012.\",\n\t\"owner_org\":
